import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { AuthContextProvider } from './component/usecontext/authcontext';
import { HotelSearchContextProvider } from './component/usecontext/usecontext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
      <AuthContextProvider>
        <HotelSearchContextProvider>
          <App/>
        </HotelSearchContextProvider>
      </AuthContextProvider>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
